query:
/*+ NoHashJoin(ci t mi_idx) */ select count(*)
from cast_info AS ci
inner join title AS t
on t.id = ci.movie_id AND ci.person_id = 3781799 AND ci.role_id > 4 AND t.kind_id > 1 AND t.production_year > 2009
inner join movie_info_idx AS mi_idx
on t.id = mi_idx.movie_id AND mi_idx.info_type_id > 100;
